import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from "../pages/Index";
import Gallery from '../pages/Gallery';
import LoginForm from './LoginForm';
import LogoutScreen from './LogoutScreen';

function Login() {
    const [loggedIn, setLoggedIn] = useState(false);
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [redirectToHome, setRedirectToHome] = useState(false); 

    const handleLogin = () => {
        if (username === 'admin' && password === 'admin') {
            setLoggedIn(true);
            setRedirectToHome(true); 
        } else {
            alert("Invalid username or password");
        }
    };

    const handleLogout = () => {
        setLoggedIn(false);
        setUsername('');
        setPassword('');
        setRedirectToHome(false);
    };

    return (
        <Router>
            <div>
                <nav className="navbar navbar-expand-lg navbar-dark bg-secondary">
                    <div className="container">
                        <Link to="/" className="navbar-brand">KittyDeluxe</Link>
                        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"></span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarNavDropdown">
                            <ul className="navbar-nav mr-auto">
                                <li className="nav-item">
                                    <Link to="/home" className="nav-link">Home</Link>
                                </li>
                                <li className="nav-item">
                                    <Link to="/gallery" className="nav-link">Gallery</Link>
                                </li>
                            </ul>
                            <ul className="navbar-nav ml-auto">
                                {loggedIn ? (
                                    <li className="nav-item">
                                        <Link to="/logout" onClick={handleLogout} className="nav-link">Logout</Link>
                                    </li>
                                ) : (
                                    <li className="nav-item">
                                        <Link to="/" className="nav-link">Login</Link>
                                    </li>
                                )}
                            </ul>
                        </div>
                    </div>
                </nav>
                <div className="container mt-4"> {/* Adding padding below the navbar */}
                    <Routes>
                        {redirectToHome && <Route path="/" element={<Home />} />}
                        <Route path="/" element={<LoginForm handleLogin={handleLogin} username={username} setUsername={setUsername} password={password} setPassword={setPassword} />} />
                        <Route path="/home" element={loggedIn ? <Home /> : null} />
                        <Route path="/gallery" element={loggedIn ? <Gallery /> : null} />
                        <Route path="/logout" element={loggedIn ? <Logout handleLogout={handleLogout} /> : <LogoutScreen/>} />
                    </Routes>
                </div>
            </div>
        </Router>
    );
}

function Logout({ handleLogout }) {
    handleLogout();
    return null; 
}

export default Login;
